def check_abundant(n):
    if n <= 1:
        return False
    sum_divisors = 1  # 1 is a proper divisor for all n > 1
    sqrt_n = int(n ** 0.5)
    for i in range(2, sqrt_n + 1):
        if n % i == 0:
            sum_divisors += i
            other = n // i
            if other != i:
                sum_divisors += other
    return sum_divisors > n

