        i >>= 1
    return count

def longest_increasing_subsequence(lst):
    if not lst:
        return 0
    tails = []
    for num in lst:
        index = bisect.bisect_left(tails, num)
        if index == len(tails):
            tails.append(num)
        else:
            tails[index] = num
    return len(tails)

def odd_Num_Sum(n):
